import React from 'react';
import { Link } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div className="app-page">
      <nav className="app-nav">
        <Link to="/" className="app-link">Home</Link>
        <Link to="/planner" className="app-link">Planner</Link>
        <Link to="/activity-setter" className="app-link">Activity Setter</Link>
      </nav>
      <div className="app-container">
        <h2 className="app-title">Welcome to the Goal Planner</h2>
        <p className="app-description">
          Set and track your goals with ease. Stay on top of your progress with the planner and activity setter.
        </p>
      </div>
    </div>
  );
}

export default App;
